<p>快速排序中提到了一些最坏情形，当元素不够乱序，或者是重合元素过多时，快速排序越慢。</p>
<p>到目前为止，我们实现的算法都是一次性准备好的输入数据，求一个输出。
这意味着输入的数据总是有限的，与之相对应的，也有“无限”的输入，比如<strong>流</strong>，这里就不展开了。</p>
<p>输入的数据是有限的，就意味着输入的每个元素的种类是有限的。如果每个元素不是各不相同，那就必然有重复的数据。</p>
